import React from 'react';
import {
    Link
} from 'react-router-dom';


const Header = () => {
    // let status =  localStorage.setItem("isLogin", false);

    return ( <
        div className = "ui secondary pointing menu" >
        <
        Link to = "/"
        className = "item" > Demo App < /Link> <
        Link to = "/Login"
        className = "ui button primary" > Login < /Link> <
        Link to = "/SignUp"
        className = "ui button primary" > SignUp < /Link> <
        /div>

    );
};
export default Header;
